📌Сегодня, 24 мая, состоялась форсайт-сессия "Разговоры о важном 2023/2024".

🖋Форсайт – это формат коммуникации, позволяющий участникам 
договориться по поводу образов будущего.

Активисты колледжа, старосты групп, работая в команде, проанализировали то, как в нашем колледже проходили занятия "Разговоры о важном" в течение всего учебного года, выделили плюсы и минусы, обсудили важность проведения этих занятий.

✅В основной части форсайт-сессии, студенты, исходя из своих интересов, потребностей, предложили свои идеи по будущим темам внеурочных занятий «Разговоры о важном», интересные с точки зрения обучающихся форматы проведения занятий, провели обсуждение, выбрали наиболее яркие идеи для разработчиков цикла внеурочных занятий «Разговоры о важном». 

Студенты вместе с модератором сессии, советником директора по воспитанию, проработали такие направления, как 
👉семья и семейные традиции; 
👉 исторический контекст: через века к современности, события, люди, идеи; 
👉 достижения России, технологический суверенитет страны; 
👉культурное многообразие нашей страны; 
👉 возможности развития для детей и молодежи; 
👉 профессии и труд; 
👉 здоровье; 
👉 экология и сохранение окружающей среды.
